(8, '', 'OASIK Rectangle house', 17, NULL, NULL, '<p>The short answer is yes. According to Kross, when you think of yourself as another person, it allows you give yourself more objective, helpful feedback.</p>\r\n\r\n<p><img alt=\"News Banner\" src=\"https://digihostsolutions.com/fed-projects/cybarc/assets/images/news/large-size/interior/1-1170x650.jpg\" /></p>\r\n\r\n<h3>Defaulting to mindfulness</h3>\r\n\r\n<p>Cray post-ironic plaid, Helvetica keffiyeh tousled Carles banjo before they sold out blog photo booth Marfa semiotics Truffaut. Mustache Schlitz next level blog Williamsburg, deep v typewriter tote bag Banksy +1 literally.</p>\r\n\r\n<ul>\r\n	<li>Welsh novelist Sarah Waters sums it up eloquently</li>\r\n	<li>In their classic book, Creativity in Business, based on a popular course they co-taught</li>\r\n	<li>Novelist and screenwriter Steven Pressfield</li>\r\n</ul>\r\n\r\n<p>That immediately brought to mind one of&nbsp;<a href=\"javascript:void(0)\">my fondest</a>&nbsp;memories, involving my daughter when she was just a toddler of one.</p>\r\n', 'To mark the first UK show of artist Henri Barande, graphic designer Peter Parker and German studio Schultzschultz', NULL, NULL, 1, NULL, '2024-12-13', NULL, '7af0c1606e263b62fb7c150d01fbe255_2.jpg', 'https://localhost/Cybarc/uploads/blog_feature_img/7af0c1606e263b62fb7c150d01fbe255_2.jpg', '7af0c1606e263b62fb7c150d01fbe255_1.jpg', 'oasik-rectangle-house', 'https://localhost/Cybarc/uploads/blog_main_img/7af0c1606e263b62fb7c150d01fbe255_1.jpg', NULL, 1, '2024-12-13 12:31:01', '', '', '', '', '', '', 0);
